import React from "react";
import SectionTitle from "../UI/SectionTitle";

const FeaturedWorks = (props) => {
  return (
    <div>
      <SectionTitle subHeading="My Works" heading="Featured Works" />;
    </div>
  );
};

export default FeaturedWorks;
